pragma solidity 0.5.7;
pragma experimental ABIEncoderV2;

import { ERC20Taxable } from "./ERC20.sol";


/**
 * @title Rapport
 * @dev ERC20Taxable token that can be used to vote on applications to the society0x registry.
 */
contract Rapport is ERC20Taxable {

    string public constant name = "Rapport";
    string public constant symbol = "RAP";
    uint8 public constant decimals = 18;
    string public version = "0.0.1";

    uint public constant INITIAL_SUPPLY = 4000000000e18; // 4 billion
    uint public constant FINAL_SUPPLY = 400000000000000e18; // 400 trillion

    address public registry;
    address public governance;
    uint8 public taxRatePercent;
    address public taxCommunityPool;
    address public taxDevelopmentPool;

    constructor(address _registry, address _governance, uint8 _taxRatePercent, address _taxCommunityPool, address _taxDevelopmentPool) public ERC20Taxable(_governance, _taxRatePercent, _taxCommunityPool, _taxDevelopmentPool) {
        registry = _registry;
        governance = _governance;
        taxRatePercent = _taxRatePercent;
        taxCommunityPool = _taxCommunityPool;
        taxDevelopmentPool = _taxDevelopmentPool;
        _mint(msg.sender, INITIAL_SUPPLY);
    }

    function mint(address account, uint256 value) public {
        require(msg.sender == registry, "Rapport::mint: Only the registry can mint new tokens");
        require(totalSupply().add(value) <= FINAL_SUPPLY, "Rapport::mint: Exceeds final supply");

        _mint(account, value);
    }

    function setTaxRate(uint8 _taxRatePercent) public {
        require(msg.sender == governance, "Governance::setTaxRate: Tax rate can only be set via governance");
        taxRatePercent = _taxRatePercent;
    }

    function setTaxCommunityPool(address _taxCommunityPool) public {
        require(msg.sender == governance, "Governance::setTaxCommunityPool: Community tax pool address can only be set via governance");
        taxCommunityPool = _taxCommunityPool;
    }

    function setTaxDevelopmentPool(address _taxDevelopmentPool) public {
        require(msg.sender == governance, "Governance::setTaxDevelopmentPool: Development tax pool can only be set via governance");
        taxDevelopmentPool = _taxDevelopmentPool;
    }

}
